package javaProgramsExample;

public class PrimeNumber {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		
		int s=10;
		for(int i=0;i<=s;i++)
		if(i%2==0)
		{
			System.out.println("it is not prime number "+s);
		}
		else
		{
			System.out.println("it is  prime number "+s);
		}
		
		

	}

}
